import React from "react";
import CollectionItem from "../CollectionItem/CollectionItem";
import {
  CollectionPreviewContainer,
  TitleContainer,
  PreviewContainer,
} from "./CollectionPreviewStyles";
import { HATS, JACKETS, SNEAKERS, WOMENS, MENS } from "../../constants/routes";
import { SECTION_TITLES } from "../../constants/misc";

const COLLECTION_PREVIEW_MAP = {
  [SECTION_TITLES.hats]: HATS,
  [SECTION_TITLES.jackets]: JACKETS,
  [SECTION_TITLES.sneakers]: SNEAKERS,
  [SECTION_TITLES.womens]: WOMENS,
  [SECTION_TITLES.mens]: MENS,
};

const CollectionPreview = ({ title, items }) => {
  console.log("title", title);
  return (
    <CollectionPreviewContainer>
      <TitleContainer to={COLLECTION_PREVIEW_MAP[title]}>
        {title.toUpperCase()}
      </TitleContainer>
      <PreviewContainer>
        {items
          .filter((item, index) => index < 4)
          .map((item) => (
            <CollectionItem key={item.id} item={item} />
          ))}
      </PreviewContainer>
    </CollectionPreviewContainer>
  );
};

export default CollectionPreview;
